import axios from "axios";

export const getEvents = (location) => {
    let instance = axios.create({
        baseURL: "http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2"
    })
    return axios.get("http://api.eventful.com/json/events/search?app_key=HkgwXkPs5xHpDpR2&location=paris").then((res) => {
        return res;
    }).catch((err) => {
        console.log(err);
    });
}
